import React from "react";
import Loading from "../LoadingError/Loading";
import Message from "../LoadingError/Error";
//import { Link } from "react-router-dom";
//import moment from "moment";

const Transactions = (props) => {
  const { loading, error /*, transactions*/ } = props;
  return (
    <div className=" d-flex justify-content-center align-items-center flex-column">
      {loading ? (
        <Loading />
      ) : error ? (
        <Message variant="alert-danger">{error}</Message>
      ) : (
        <>
          <div className="container mt-5">
            <div className="row align-items-start mb-5 my-acc">
              <div className="col-6 align-items-start">
                <div className="row">
                  <h3>Citizen current account</h3>
                  <p>account number: 258</p>
                </div>
                <div className="row justify-content-between">
                  <p>account balance:</p>
                  <h2>$1.589</h2>
                </div>
                <div className="row justify-content-between">
                  <p>account balance:</p>
                  <h2>$1.589</h2>
                </div>
              </div>
              <div className="col-6 align-items-start">
                <div className="row justify-content-between">
                  <h2>Name:</h2>
                  <h2>Admin</h2>
                </div>
                <div className="row justify-content-between">
                  <h2>Address:</h2>
                  <h2>PETI PRIGRADSKI PUT BB</h2>
                </div>
                <div className="row justify-content-between">
                  <h2>City:</h2>
                  <h2>BANJALUKA</h2>
                </div>
                <div className="row justify-content-between">
                  <h2>Purpose of payment:</h2>
                  <h2>BANJALUKA</h2>
                </div>
              </div>
            </div>
            <div className="row align-items-start mb-5 trans-to">
              <div className="col-6 align-items-start"></div>
              <div className="col-6 align-items-start"></div>
            </div>
          </div>
        </>
      )}
    </div>
  );
};

export default Transactions;
